import React from "react";
import "./App.css";
import Car from "./components/Car";
import Welcome from "./components/Welcome";

function App() {
  return (
    <>
    <div className="App">
        <header className="App-header">
          <h1>WELCOME</h1>
        </header>
      </div>
      <Car />
      <Welcome></Welcome>
    </>
  );
}

export default App;
